#include <utility>
#include <queue>
#include <assert.h>
using namespace std;

class Solution {
public:
    int getFood(vector<vector<char>>& grid) {
        int m = grid.size();
        int n = grid[0].size();

        int y;
        int x;

        for (int i=0; i<m; i++){
            for (int j=0; j<n; j++){
                if (grid[i][j] == '*'){
                    y = i;
                    x = j;
                    break;
                }
            }
        }

        queue<pair<int, int>> q;
        q.push({y,x});
        int steps = 0;

        while (!q.empty()){
            int size = q.size();
            for(int k=0; k<size; k++){
                auto [i, j] = q.front();
                q.pop();
                // cout << steps << " " << i << " " << j << endl;
                int pos[] = {1,0,-1,0,1};
                for (int k=0; k<4; k++){
                    int newi = i+pos[k];
                    int newj = j+pos[k+1];
                    if (0 <= newi && newi < m && 0 <= newj && newj < n){
                        if (grid[newi][newj] == '#'){
                            return steps + 1;
                        }
                        else if (grid[newi][newj] != 'X'){
                            grid[newi][newj] = 'X';
                            q.push({newi,newj});
                        }
                    }
                }
            }
            steps++;
        }
        return -1;
    }
};

